import React, { useState } from 'react';
import './FuelQuoteForm.css'; // Import your CSS file

const FuelQuoteForm = () => {
  // ...

  return (
    <div className="container">
      <h2>Fuel Quote Form</h2>
      <form onSubmit={handleSubmit}>
        <label>
          In State:
          <input
            className="checkbox"
            type="checkbox"
            checked={inState}
            onChange={(e) => setInState(e.target.checked)}
          />
        </label>

        <label>
          Client History:
          <input
            className="text-input"
            type="text"
            value={clientHistory}
            onChange={(e) => setClientHistory(e.target.value)}
          />
        </label>

        <label>
          Gallons:
          <input
            className="number-input"
            type="number"
            step="0.01"
            value={gallons}
            onChange={(e) => setGallons(e.target.value)}
          />
        </label>

        <label>
          Profit Margin:
          <input
            className="number-input"
            type="number"
            step="0.01"
            value={profitMargin}
            onChange={(e) => setProfitMargin(e.target.value)}
          />
        </label>

        <label>
          Profile Complete:
          <input
            className="checkbox"
            type="checkbox"
            checked={profileComplete}
            onChange={(e) => setProfileComplete(e.target.checked)}
          />
        </label>

        <label>
          Fuel Quotes (comma-separated, e.g., 1.5,2.0,3.1):
          <input
            className="text-input"
            type="text"
            value={fuelQuotes.join(',')}
            onChange={(e) => setFuelQuotes(e.target.value.split(','))}
          />
        </label>

        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default FuelQuoteForm;
